import React, { Component } from "react";
import * as TagNames from "../constants/constants";
import axios from "axios";
import Movies from "../common/movies";
// import { GetJSON } from "../common/getjson";

class Home extends Component {
  state = {
    data: {
      page: "",
      results: [],
      total_pages: "",
      total_results: "",
    },
  };

  async componentDidMount() {
    const { data } = await axios.get(TagNames.getURL());
    this.setState({ data });
    console.log(data.results);
  }

  render() {
    const { results } = this.state.data;
    const imagepath = TagNames.getImagePath();
    if (results.length === 0) {
      return <h3>Movies not found.</h3>;
    }

    return <Movies moviesList={results} />;
  }
}

export default Home;
